import React from 'react';
import Hero from '../Hero/Hero'
import { Container , Row, Col} from 'react-bootstrap';
import classes from './Form.module.scss';

const Form = props => {
  return (
    <Container>
    <Row>
      <Col sm={12} md={6}>
        <Hero></Hero>
      </Col>
    </Row>
  </Container>
  );
};

export default Form;
